def normalize(surname):
	n = surname.upper()
	n = re.sub('\s+','',n) # remove spaces
	# de-punctuationlize
	for (r,p) in [
		('', '\s+'),
		('A', '[ÀÁÂÄÃẦĀ]'),
		('C', '[Ç]'),
		('E', '[ÈÉÊËỄỆ]'),
		('I', '[ÌÍÎÏĪ]'),
		('O', '[ÒÓÔÕÖỖƠŌ]'),
		('N', '[Ñ]'),
		('U', '[ÙÚÛÜŨƯ]'),
		('Y', '[ÝŸỲ]'),
		('', "['’]")]:
		n = re.sub(p, r, n, re.UNICODE)
	return n

